import { isAdjacent } from "../../node/double-expansion/is-adjacent.js";


/**
 * Returns true if the given floating point expansion is non-adjacent and 
 * components of the expansion are ordered in ascending order by absolute value,
 * except that some components may be zero.
 * See https://people.eecs.berkeley.edu/~jrs/papers/robustr.pdf for the 
 * definition of adjacency.
 * Implemented for testing purposes.
 * @param x A floating point expansion.
 */
function isValid(x: number[]): boolean {
    for (let i=1; i<x.length; i++) {
        if (x[i] !== 0 && x[i-1] !== 0 && 
            Math.abs(x[i-1]) >= Math.abs(x[i])) {

            //console.log('Not in ascending order.');
            return false;
        }

        if (isAdjacent(x[i-1], x[i])) {
            //console.log('The expansion has adjacent components.');
            return false;
        }
    }

    return true;
}


export { isValid }

import { expect, assert } from 'chai';
import { describe } from 'mocha';

import { eCompare } from '../../node/index.js';


describe('eCompare', function() {
	it('should correctly eCompare some floating point number expansions', 
	function() {
        // 0 === 0
        assert(eCompare([0], [0]) === 0); 

        assert(eCompare([1], [0]) > 0); 

        assert(eCompare([0], [10]) < 0); 

        assert(eCompare(
            [-2.7755575615628914e-17, 0.30000000000000004], 
            [10]) < 0
        ); 

        assert(eCompare(
            [-2.7755575615628914e-17, 0.30000000000000004], 
            [0.3]) > 0
        ); 
	});
});

import { expect, assert } from 'chai';
import { describe } from 'mocha';
import { eCompress } from '../../node/index.js';
import { isNonOverlappingAll } from '../../node/double-expansion/is-overlapping.js';
import { isValid } from '../helpers/is-valid.js';


/**
 * 
 * @param e 
 * @param res 
 */
function check(e: number[], res: number[]) {
    assert(
        isNonOverlappingAll(e),
        'The input should be a non-overlapping expansion.'
    );

    let result = eCompress(e);

    assert(
        isValid(result),
        'The result should be a non-overlapping, non-adjacent expansion'
    );

    expect(result).to.eql(res);
}


describe('eCompress', function() {
	it('should correctly eCompress some floating point number expansions', 
	function() {
        check(
            [1, 2, 4, 8],
            [15]
        );

        check(
            [0, 0, -5.551115123125783e-17, 0.6000000000000001],
            [-5.551115123125783e-17, 0.6000000000000001]
        );

        check(
            [0,3],
            [3]
        );

        check(
            [0, 2e-101, 0, 4.6e-81, 0, 9.12e-61, 0, 1.56e-40, 0, 1.998e-20],
            [2e-101, 4.6e-81, 9.12e-61, 1.56e-40, 1.998e-20]
        );
	});
});

